  false,\n\t\"url\": null,\n\t\"notes\": \"Baseline (1961-1990) average summer total
  precipitation and projected change in precipitation for the northern portion of
  Alaska. For the purposes of these maps, 'summer' is defined as June - August. The
  Alaska portion of the Arctic LCC's terrestrial boundary is depicted by the black
  line. Baseline results for 1961-1990 are derived from Climate Research Unit (CRU)
  TS 3.1.01 data and downscaled to 2km grids; results for the other time periods (2010-2039,
  2040-2069, 2070-2099) are based on the SNAP 5-GCM composite using the AR5-RCP 8.5,
  downscaled to 2km grids.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
